script: |
  super -f text -I q346.spq | sort > q346.out

inputs:
  - name: q346.spq
    data: |
      SELECT DISTINCT - 89 * col2 AS col1 FROM tab1 (FORMAT parquet) WHERE ( - col0 ) NOT BETWEEN + col2 * 42 + CAST ( 21 AS INTEGER ) AND ( + col1 );
  - name: tab1

outputs:
  - name: q346.out
    data: |
      -5251
      -6052
      -8544
